function resetLights()
	for _, midi_note in MIDI_TABLE do
		local light = getLight(midi_note);

		if light then		
			if isSharp(midi_note) then
				pcall(function() light:SetColor(Color3.fromRGB(0, 0, 0)) end);
			else
				pcall(function() light:SetColor(Color3.fromRGB(110, 110, 110)) end);
			end
		end
	end
end

local playing = false;
local stopped = true;

local ms_per_quarter_note = 1000;

local TEMPO_DISPLAY;
local SONG_DISPLAY;

local SELECTED_SONG = "nil";

-- init gui -----------
function initGUI()
	-- song selection
	local frame = screen:CreateElement("ScrollingFrame", {
		Size = UDim2.fromScale(.5, 1);
		Position = UDim2.fromScale(0, 0);
		BackgroundColor3 = Color3.fromRGB(50, 50, 50);
		BackgroundTransparency = 0;

		AutomaticCanvasSize = 2;
		ZIndex = 1;
	});

	local offset = 0;
	for song, data in pairs(songs) do
		local song_button = screen:CreateElement("TextButton", {
			Text = song;
			Size = UDim2.fromScale(.8, 0) + UDim2.fromOffset(0, 40);
			Position = UDim2.fromScale(.1, .1) + UDim2.fromOffset(0, offset);
		})

		offset += 40;

		song_button.MouseButton1Click:Connect(function() 
			SELECTED_SONG = song;
			SONG_DISPLAY.Text = song;
		end)

		frame:AddChild(song_button);
		ZIndex = 2;
	end
	--


	-- play control stuff
	local frame = screen:CreateElement("Frame", {
		Size = UDim2.fromScale(.5, 1);
		Position = UDim2.fromScale(.5, 0);
		BackgroundColor3 = Color3.fromRGB(50, 50, 50);
	});

	local songDisplay = screen:CreateElement("TextLabel", {
		Size = UDim2.fromScale(1, .4);
		Position = UDim2.fromScale(0, 0);
		Text = "nil";
		TextColor3 = Color3.fromRGB(255, 255, 255);
		TextScaled = true;
	})

	local tempoDisplay = screen:CreateElement("TextLabel", {
		Size = UDim2.fromScale(1, .3);
		Position = UDim2.fromScale(0, .4);
		Text = tostring(ms_per_quarter_note);
		TextColor3 = Color3.fromRGB(255, 255, 255);
		TextScaled = true;
	});


	local playButton = screen:CreateElement("TextButton", {
		Size = UDim2.fromScale(1, .3);
		Position = UDim2.fromScale(0, .7);
		Text = "Play";
	});

	keyboard:Connect("TextInputted", function(val, player)
		local str = val:sub(1, -2);
		local num = tonumber(str);

		ms_per_quarter_note = num;
		TEMPO_DISPLAY.Text = num;
	end)

	playButton.MouseButton1Click:Connect(function()

		if SELECTED_SONG ~= "nil" then
			local song = songs[SELECTED_SONG];

			playing = false;

			task.wait(1);
			resetLights();

			playing = true;

			ms_per_quarter_note = song["tempo"];
			TEMPO_DISPLAY.Text = tostring(song["tempo"]);

			play(songs[SELECTED_SONG]["data"])
		end
	end);	

	SONG_DISPLAY = songDisplay;
	TEMPO_DISPLAY = tempoDisplay;

	frame:AddChild(songDisplay);
	frame:AddChild(tempoDisplay);
	frame:AddChild(playButton);
	--

end

function play(data)
	local seconds;
	stopped = false;

	print("starting")
	for i, event in data do
		if not playing then 
			break; 
		end

		if event.d == 0 then
			seconds = 0;
		else
			local thingy = ms_per_quarter_note / event.d;
			seconds = 1 / thingy;
		end

		task.wait(seconds);

		if next(event.o) then
			for i, v in event.o do
				local midi_note = getMidi(v);
				local res, note = pcall(getNote, midi_note);
				local light = getLight(midi_note);

				if note then
					pcall(function() note:Trigger() end);
				else 
					print("out of range!: " .. midi_note);
					pcall(function() light:SetColor(Color3.fromRGB(255, 0, 0)) end);
					continue;
				end

				if light then			

					if isSharp(midi_note) then
						pcall(function() light:SetColor(Color3.fromRGB(150, 150, 150)) end);
					else
						pcall(function() light:SetColor(Color3.fromRGB(250, 250, 250)) end);
					end
				else
					print("No light for: " .. midi_note);
					continue;
				end
			end
		end

		if next(event.f) then
			for i, v in event.f do
				local midi_note = getMidi(v);
				local light = getLight(midi_note);

				if light then
					if isSharp(midi_note) then
						pcall(function() light:SetColor(Color3.fromRGB(0, 0, 0)) end);
					else
						pcall(function() light:SetColor(Color3.fromRGB(110, 110, 110)) end);
					end
				else 
					print("No light for: " .. midi_note);
				end
			end
		end

	end

	stopped = true;
end

resetLights();
initGUI();
